    const action = { type: "GETARTICLE", value: e }
    this.props.dispatch(action)
  }

  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-md-2">
          </div>


          <div className="col-md-10">
            <div className="flexible-content">
              {/* {this.renderRedirect()} */}
              <TopNavigation />
              <SideNavigation />
              <main id="content" className="p-5">
                <Routes />
              </main>
              <Footer />

              {/* TEST CARDS */}
              {/* <!--Card--> */}
              <div class="card card-cascade card-ecommerce wider">

                {/* <!--Card image--> */}
                <div class="view view-cascade overlay">
                  <img class="card-img-top" src="https://mdbootstrap.com/img/Photos/Horizontal/E-commerce/Products/shoes%20(3).jpg"
                    alt="" />
